INSERT INTO `api_question` VALUES (1,7,40,1458555988,'<p>删除商品收藏</p><p><br/></p>',1,1458555989),(2,7,4,1459822993,'<p>增加name参数</p>',0,0),(3,7,1,1459932442,'<p>增加<span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 20px; white-space: normal;\">has_pay_password返回参数，原账号是否有支付密码</span></p><p><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 20px; white-space: normal;\"><br/></span></p>',0,0),(4,7,58,1460084232,'<p>支付宝订单支付成功回调地址</p><p>http://域名/gateway/alipay/order_notify.php</p><p>微信订单支付成功回调地址</p><p>http://域名/gateway/wechat/order_notify.php</p>',0,0),(5,7,21,1460105814,'<p>返回参数调整</p>',0,0),(6,7,57,1460341968,'<p>增加money参数</p>',0,0),(7,7,57,1460343604,'<p>订单价格的一些计算公式</p><p>对于已经支付的订单:</p><p>money+pay_money = orderamount =&nbsp;<span style=\"line-height: 22.8571px; white-space: normal;\"></span><span style=\"line-height: 22.8571px; white-space: normal;\">goodsamount+feeamount+taxamount - discount</span></p><p>未支付的订单</p><p>pay_money = 0;</p><p><span style=\"line-height: 22.8571px; white-space: normal;\">goodsamount+feeamount+taxamount - discount = orderamount</span></p>',0,0),(8,7,57,1460343794,'<p>计算应支付的金额为</p><p><span style=\"color:#ff0000\">pay_money = orderamount - money;</span></p>',0,0),(9,7,46,1460360728,'<p><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 20px; white-space: normal;\">当endtime为0的时候为不限制结束时间</span></p><p><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 20px; white-space: normal;\"><br/></span></p>',0,0),(10,7,21,1460705028,'<p>返回参数增加address</p>',0,0),(11,7,60,1461048287,'<p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">全部订单 无参数</span></p><p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">待付款 status=1 pay_status=0</span></p><p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">待发货 pay_status=1 status=1 way_status=0</span></p><p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">待评论 receive=1 status=1 complete=0</span></p><p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">待收货 status=1 way_status=1 receive=0</span></p>',0,0),(12,7,60,1461050988,'<p>因为这个接口需要签名验证，当没有传递任何参数的时候接口可能报错，所以当获取所有订单的时候请提交start和length参数</p>',0,0),(13,7,35,1461313788,'<p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">支付宝:</span></p><p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">http://域名/gateway/alipay/vip_notify.php</span></p><p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">微信:</span></p><p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\"><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">http://域名/gateway/wechat/vip_notify.php</span></span></p>',0,0),(14,7,57,1461570549,'<p>增加clear参数</p>',0,0),(15,7,71,1462271212,'<p>当任务列表中的order不为空的时候，说明这个任务已经开启了，order中的orderno是订单号，其他信息不用管</p><p><br/></p>',1,1462621455),(16,7,73,1462275614,'<p>so_order:已经完成支付的跟团订单</p>',1,1462621434),(17,7,74,1462276556,'<p>任务订单支付地址</p><p>支付宝:</p><p>http://域名/gateway/支付方式(alipay or wechat)/task_notify.php</p>',1,1462621381),(18,7,73,1462428340,'<p>增加status字段</p><p><br/></p>',1,1462621436),(19,7,74,1462431840,'<p>新增收货地址id参数</p>',1,1462621443),(20,7,74,1462621420,'<p>团购订单支付的异步回调地址按照普通<span style=\"line-height: 1.42857;\">订单的异步回调地址处理</span></p>',0,0),(21,7,91,1462621427,'<p><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 20px; white-space: normal; background-color: rgb(245, 246, 250);\">团购订单支付的异步回调地址按照普通</span><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 1.42857; white-space: normal; background-color: rgb(245, 246, 250);\">订单的异步回调地址处理</span></p>',0,0),(22,7,73,1462621438,'<p><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 20px; white-space: normal; background-color: rgb(245, 246, 250);\">团购订单支付的异步回调地址按照普通</span><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 1.42857; white-space: normal; background-color: rgb(245, 246, 250);\">订单的异步回调地址处理</span></p>',0,0),(23,7,71,1462621457,'<p><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 20px; white-space: normal; background-color: rgb(245, 246, 250);\">团购订单支付的异步回调地址按照普通</span><span style=\"font-family: &#39;Open Sans&#39;, sans-serif; font-size: 14px; line-height: 1.42857; white-space: normal; background-color: rgb(245, 246, 250);\">订单的异步回调地址处理</span></p>',0,0),(24,18,108,1464772381,'<p><span style=\"color: rgb(33, 4, 6); font-family: &#39;Open Sans&#39;, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(254, 247, 248);\">code=0 手机号码格式错误 code=1 短信发送成功 code=2 该手机号已注册 code=4 短信发送失败，请稍后再发送</span></p>',1,1464772385);
