INSERT INTO `project` VALUES (1,7,'微购',0,'微购项目开发文档',1456827919,0,NULL,0,'www.twillg.com','<h3><strong>前言：</strong></h3><p>接口分为2种</p><p><span style=\"color:#ff0000\">1、需要签名验证,关于签名验证后面会说道。</span></p><p><span style=\"color:#ff0000\">2、不需要签名验证，不需要签名验证的直接提交数据即可。不需要签名验证的接口会单独在接口说明中说明，否则一律为需要签名验证的接口。</span><br/></p><p><br/></p><h3><strong>PARTNER：</strong></h3><p>现在提供2个partner和key测试</p><p>partner:ios &nbsp;key:ios</p><p>partner:android &nbsp;key:android</p><p><br/></p><h3><strong>签名验证:</strong></h3><ol><li><p><span style=\"line-height: 1.42857;\">提交的参数名外面要用字符串&quot;<span style=\"color:#ff0000\">data[参数名]</span>&quot;包裹</span></p></li><li><p><span style=\"line-height: 1.42857;\">提交的参数要增加partner参数，<span style=\"color:#ff0000\"><span id=\"_baidu_bookmark_start_18\" style=\"display: none; line-height: 0px;\">‍</span></span></span><span id=\"_baidu_bookmark_start_20\" style=\"display: none; line-height: 0px;\">‍</span>partner参数名<span style=\"color:#ff0000\">不需要</span>&quot;data[partner]&quot;包裹<span id=\"_baidu_bookmark_end_21\" style=\"display: none; line-height: 0px;\">‍</span><span style=\"line-height: 1.42857;color:#ff0000\"><span id=\"_baidu_bookmark_end_19\" style=\"display: none; line-height: 0px;\">‍</span></span></p></li><li><p><span style=\"line-height: 1.42857;\">在提交参数的时候需要传递一个额外的sign参数，sign参数值为签名生成的字符串，sign参数名<span style=\"color:#ff0000\">不需要</span>&quot;data[sign]&quot;包裹</span><br/></p></li></ol><h3><strong><span style=\"color:#000000\">签名验证过程（sign参数值生成过程）：</span></strong></h3><p><span style=\"color:#000000\">注意：</span><span style=\"color:#ff0000\">签名过程需要partner和key的参与</span></p><ol><li><p><span style=\"color:#000000\"><strong>将传入的参数组合成一个数组，命名为parameter</strong></span></p></li><li><p><strong>将parameter的key进行升序排序</strong></p></li><li><p><strong>将parameter按照 key1=value1&amp;key2=value2...的形式组合成一个字符串</strong></p></li><li><p><strong>将上面生成的字符串按照RFC1783和<em style=\"text-rendering: optimizeLegibility; color: rgb(51, 51, 51); font-family: &#39;Fira Sans&#39;, &#39;Source Sans Pro&#39;, Helvetica, Arial, sans-serif; line-height: 24px; white-space: normal; background-color: rgb(242, 242, 242);\">application/x-www-form-urlencode<span id=\"_baidu_bookmark_start_1\" style=\"display: none; line-height: 0px;\">‍</span></em></strong><span id=\"_baidu_bookmark_start_3\" style=\"display: none; line-height: 0px;\">‍</span><strong>媒体类型经行编码(urlencode算法)，编码规则如下</strong></p><table board=\"1\" log-set-param=\"table_view\" style=\"margin-top: 5px; margin-bottom: 5px; word-wrap: break-word; word-break: break-all; font-size: 12px; line-height: 22px; color: rgb(0, 0, 0); font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><tbody><tr><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">空格</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">!</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">#</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">$</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">+</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">@</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">:</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">=</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%3F</td></tr><tr><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%20</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%21</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%23</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%24</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%25</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%2B</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%40</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%3A</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">%3D</td><td width=\"48\" valign=\"top\" style=\"margin: 0px; padding-top: 2px; padding-bottom: 2px; height: 22px; border-color: rgb(230, 230, 230);\">?</td></tr></tbody></table></li><li><p><strong>将编码后的字符串全部转化为小写</strong></p></li><li><p><strong>拼接上partner参数和key参数，生成待签名字符串</strong></p></li><li><p><strong>对待签名字符串进行md5散列，生成签名后的字符串</strong></p></li><li><p><strong>对签名后的字符串全部转化为大写</strong></p></li></ol><p><strong>注意:urlencode算法有不同的标准，这里使用RFC1783标准</strong></p><p><strong><br/></strong></p><h3><strong>签名举例:</strong></h3><p>这里用用户登录接口举例。</p><p>待提交的参数</p><pre class=\"xdebug-var-dump\" dir=\"ltr\" style=\"color: rgb(0, 0, 0); line-height: normal;\"><strong>array</strong> <em>(size=2)</em>\n  &#39;telephone&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;18548143019&#39;</span> <em>(length=11)</em>\n  &#39;password&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;18548143019&#39;</span> <em>(length=11)</em></pre><p>1、排序后的内容:</p><pre class=\"xdebug-var-dump\" dir=\"ltr\" style=\"color: rgb(0, 0, 0); line-height: normal;\"><strong>array</strong> <em>(size=2)</em>\n  &#39;password&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;18548143019&#39;</span> <em>(length=11)</em>\n  &#39;telephone&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;18548143019&#39;</span> <em>(length=11)</em></pre><p>2、将数组拼接成字符串，并且转化为小写</p><pre class=\"xdebug-var-dump\" dir=\"ltr\" style=\"color: rgb(0, 0, 0); line-height: normal;\"><small>string</small> <span style=\"color:#cc0000\">&#39;password=18548143019&amp;telephone=18548143019&#39;</span> <em>(length=42)</em></pre><p>3、拼接上partner和key参数</p><pre class=\"xdebug-var-dump\" dir=\"ltr\" style=\"color: rgb(0, 0, 0); line-height: normal;\"><small>string</small> <span style=\"color:#cc0000\">&#39;password=18548143019&amp;telephone=18548143019iosios&#39;</span> <em>(length=48)</em></pre><p>4、生成md5散列后的字符串，并且转化为大写</p><pre class=\"xdebug-var-dump\" dir=\"ltr\" style=\"color: rgb(0, 0, 0); line-height: normal;\"><small>string</small> <span style=\"color:#cc0000\">&#39;440650E45522AB9D82B3FA7812DAC1DF&#39;</span> <em>(length=32)</em></pre><p>5、生成真正要提交的参数</p><pre class=\"xdebug-var-dump\" dir=\"ltr\" style=\"color: rgb(0, 0, 0); line-height: normal;\"><strong>array</strong> <em>(size=4)</em>\n  &#39;partner&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;ios&#39;</span> <em>(length=3)</em>\n  &#39;sign&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;440650E45522AB9D82B3FA7812DAC1DF&#39;</span> <em>(length=32)</em>\n  &#39;data[telephone]&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;18548143019&#39;</span> <em>(length=11)</em>\n  &#39;data[password]&#39; <span style=\"color:#888a85\">=&gt;</span> <small>string</small> <span style=\"color:#cc0000\">&#39;18548143019&#39;</span> <em>(length=11)</em></pre><p><br/></p><p>关于商品的属性组合</p><p>商品的属性组合是一个字符串,比如iphone6，银色，黑色的区别，有64G，128G的区别，他们的价格和库存以及样式都不一样，</p><p>为了准确定位银色64G的iphone，需要提交2个字段，一个是商品的id，系统会知道是iphone，一个是属性组合，【<span style=\"color:#ff0000\">银色,64G</span>】这个字符串</p><p>通常这个参数被命名为<span style=\"color:#ff0000\">content</span>，这样提交的参数就是2个</p><p><br/></p><p>id =&gt; 22(假设iphone的商品id为22)</p><p>content =&gt; 银色,64G(注意逗号是英文半角逗号，前后无逗号)</p><p><br/></p><p>而content的可选值一般在商品的prototype属性里面，当prototype为radio的时候就是可选的</p>',1456827919),(2,7,'CDS',0,'cds接口文档',1492079038,0,NULL,0,'192.168.2.72','<p><strong><span style=\"font-size:24px\">时间参数说明:</span></strong></p><p>php_code中的大部分接口都需要接受时间参数</p><p><span>biz_content[duration_mode](必须)</span></p><p><span style=\"font-family:宋体\">请求时候的时间范围，可选值为</span></p><p>00 &nbsp; &nbsp;<span style=\"font-family: 宋体;\">近</span>24<span style=\"font-family: 宋体;\">小时</span></p><p>01 &nbsp; &nbsp;<span style=\"font-family: 宋体;\">昨天</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>10 &nbsp; &nbsp;</span><span style=\"font-family:宋体\">近</span><span>7</span><span style=\"font-family:宋体\">天</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>11 &nbsp; &nbsp;</span><span style=\"font-family:宋体\">上周</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>20 &nbsp; &nbsp;</span><span style=\"font-family:宋体\">近</span><span>30</span><span style=\"font-family:宋体\">天</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>21 &nbsp; &nbsp;</span><span style=\"font-family:宋体\">上月</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>30 &nbsp; &nbsp;</span><span style=\"font-family:宋体\">自定义</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><br/></p><p class=\"MsoListParagraph\" style=\"text-indent:0\">当biz_content[duration_mode]为30的时候 &nbsp;biz_content[custom_duration]为必须，其中</p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>biz_content[custom_duration][start_time] &nbsp;（必须）&nbsp;</span><span style=\"font-family:宋体\">自定义时间开始时间</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>biz_content[custom_duration][end_time] （可选）&nbsp;</span><span style=\"font-family:宋体\">自定义时间结束时间</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>biz_content[custom_duration][mode] （必须）&nbsp;</span><span style=\"font-family:宋体\">自定义时间的时间颗粒度</span> </p><p class=\"MsoListParagraph\" style=\"text-indent:0\">minutely<span style=\"font-family:宋体\">（</span>5<span style=\"font-family:宋体\">分钟）</span> hourly<span style=\"font-family:宋体\">（一小时）</span> daily（一天）weekly（一周）</p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span>&nbsp;</span></p><p class=\"MsoListParagraph\" style=\"text-indent:0\"><span style=\"font-family:宋体\">当</span><span>biz_content[duration_mode]</span><span style=\"font-family:宋体\">为</span><span>30</span><span style=\"font-family:宋体\">的时候，自定义时间开始时间和颗粒度不能为空，结束时间根据颗粒度系统默认为当天（</span><span>minutely</span><span style=\"font-family:宋体\">），后一个月的前一天（</span><span>daily</span><span style=\"font-family:宋体\">）</span></p><p><br/></p>',NULL),(3,7,'123123123',0,'',1492079335,0,NULL,1,'','',1492079339);
